import styled from "styled-components";

const ButtonStyled = styled.button`
  align-items: center;
  border: none;
  border-bottom: 1px solid #718093;
  margin: 0.5em;
  font-size: 1.4em;
  color: #2f3640;
  background-color: transparent;

  &:active {
    background-color: red;
  }
`;

export default ButtonStyled;
